const HomePage = () => {
  return (
    <>
      <section>
        <div className="  w-screen  ">
          <div className="  max-w-7xl ">
            <div className="hero-txt w-full md:w-1/2 inline-block ">
              <div className="heading text-5xl font-extrabold  align-middle">
                Homeoz is your partner in healing holistically with homeopathy.
              </div>
            </div>
            <div className=" w-full m-0 md:w-1/2 inline-block ">
              <div>
                <img src="/images/hero.png" className="block"></img>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};
export default HomePage;
